import React, { Component } from 'react'
import axios from 'axios';

export default class Posts extends Component {
    state = {
        posts:[]
    }
  componentDidMount(){
    axios.get('https://jsonplaceholder.typicode.com/posts')
    .then(response => {
        this.setState({
            posts: response.data
        })
    });
  }

  render() {
    return (
      <div>
        <h1>Posts</h1>
        {
            this.state.posts
        }
      </div>
    )
  }
}
